package com.contribute.xtrct.dao.model;import java.io.Serializable;import java.util.List;import java.util.Objects;public class Vehicle implements Serializable {    private String acode;    private String country;    private String year;    private String division;    private String model;    private String trim;    private String variation;    private List<Integer> vehicleStyles;    public Vehicle(String acode, String country, String year, String division, String model, String trim, String variation) {        this.acode = acode;        this.country = country;        this.year = year;        this.division = division;        this.model = model;        this.trim = trim;        this.variation = variation;    }    public String getYear() {        return year;    }    public String getDivision() {        return division;    }    public String getModel() {        return model;    }    public String getTrim() {        return trim;    }    public String getVariation() {        return variation;    }    public String getAcode() {        return acode;    }    public String getCountry() {        return country;    }    public List<Integer> getVehicleStyles() {        return vehicleStyles;    }    public void setVehicleStyles(final List<Integer> vehicleStyles) {        this.vehicleStyles = vehicleStyles;    }    @Override    public boolean equals(final Object o) {        if (this == o) {            return true;        }        if (!(o instanceof Vehicle)) {            return false;        }        final Vehicle vehicle = (Vehicle) o;        return Objects.equals(acode, vehicle.acode);    }    @Override    public int hashCode() {        return Objects.hash(acode);    }}